/** 
 * 解压带有关键字的文件
 * @param zipFile 待解压文件
 * @param destDir 目标目录
 * @param keyword 关键字
 * @return 返回带有关键字的文件链表
 * @throws IOException IO错误时抛出
 */
public static List<File> unzipFileByKeyword(final File zipFile,final File destDir,final String keyword) throws IOException {
  if (zipFile == null || destDir == null)   return null;
  List<File> files=new ArrayList<>();
  ZipFile zf=new ZipFile(zipFile);
  Enumeration<?> entries=zf.entries();
  while (entries.hasMoreElements()) {
    ZipEntry entry=((ZipEntry)entries.nextElement());
    String entryName=entry.getName();
    if (StringUtils.isEmpty(keyword) || FileUtils.getFileName(entryName).toLowerCase().contains(keyword.toLowerCase())) {
      String filePath=destDir + File.separator + entryName;
      File file=new File(filePath);
      files.add(file);
      if (entry.isDirectory()) {
        if (!FileUtils.createOrExistsDir(file))         return null;
      }
 else {
        if (!FileUtils.createOrExistsFile(file))         return null;
        InputStream in=null;
        OutputStream out=null;
        try {
          in=new BufferedInputStream(zf.getInputStream(entry));
          out=new BufferedOutputStream(new FileOutputStream(file));
          byte buffer[]=new byte[KB];
          int len;
          while ((len=in.read(buffer)) != -1) {
            out.write(buffer,0,len);
          }
        }
  finally {
          CloseUtils.closeIO(in,out);
        }
      }
    }
  }
  return files;
}
